// redux/store.js
import { configureStore } from '@reduxjs/toolkit';
import yAxisReducer from './slices/yAxis';
import isOpacityReducer from './slices/isOpacity';
import h4TextAnimateReducer from './slices/h4TextAnimate';
import textOpacityReducer from './slices/textOpacity';

export const store = configureStore({
    reducer: {
        yAxis: yAxisReducer,
        isOpacity: isOpacityReducer,
        h4TextAnimate: h4TextAnimateReducer,
        textOpacity: textOpacityReducer
    }
});
